INSERT INTO opis_uzytkownika (uzytkownik_id, plec, pseudonim, opis, parafia_id, rodzina_id, zdjecie_profilowe_id, ulubiona_modlitwa_id) VALUES
(1, 'F', 'qanderson', 'Wojsko całość policzek narodowy. Koń 30 wartość powieść ośrodek bycie śpiewać 6. Firma 90 rola. 2 majątek alkohol ząb fałszywy. Wysoko składnik czyn mocz lato. Scena dawny ciężar pora śmierć autobus oficjalny radiowy.', 74, 2, 1, 5),
(2, 'F', 'katherine00', 'Francja herbata kontakt masa umowa ćwiczenie. Węgiel ukraiński lód Egipt święty. Rzadko ochrona własny zbiornik mowa tajemnica finansowy gwiazdozbiór. Płaski działalność spotkać tył zatrzymać. Zegar hodować mój pies. Dźwięk Pan wybitny poziom rynek mięso rada. Literatura nic mapa uznawać gazeta dzielnica. Rumunia przedstawiciel sprzęt w czasie kontynent 1000. Otwór my wypowiedź całkiem. Rzeczownik dziewięćdziesiąt trwać narodowość chłopiec. Oznaczać styczeń rozwiązanie tajemnica. Ozdobny rozmiar dziura żona. Zgromadzenie już mężczyzna dlaczego. Spotkać tylko węgiel. Określenie nosić książę zupa. Nieść ślub wchodzić katolicki. (…) kamień nigdy policjant liść obiad. Zbiór studiować władca stawiać żaba kraina. Spokój wziąć nie ma niemiecki polityk. Słyszeć praca wisieć okres spotkać tkanina również wywołać. Wypadek żeński różnica kostka chęć publiczny.', 20, 11, 2, 35),
(3, 'M', 'jhayes', 'Wykonywać kościół trzeba tysiąc. Układ publiczny ksiądz pisarz ciężar.', 80, 11, 3, 6),
(4, 'F', 'alexanderjustin', 'Tańczyć umieścić wiersz inaczej. Obejmować rada pałac 70 poruszać Szwajcaria pałac. Kraj zdolny kawałek dodać. Zabić również lekarz. Ryzyko dlaczego stolica armia okres ogień obiad wywołać. Obserwować pierwiastek praktyka w końcu słaby uśmiech. Oraz lek Ameryka gorący żaden. Sprzęt się pomieszczenie narzędzie powietrze bajka. Nocny zgromadzenie środkowy stan żaba dobro punkt. Jej wola zegar but Turcja barwa szacunek białoruski. Pogoda chwila pierś papieros zero Kraków go ciemny. Król światło chłopak. Droga Wielka Brytania mąka tradycja symbol przeszkoda. Pokryć sam wykonanie. Elektryczny uderzać fakt dać wojna ten sam.', 67, 11, 4, 23),
(5, 'F', 'pollardkari', 'No temat słodki zaburzenie. Pokój kij bycie. Niemcy papier wykorzystywać telefon Polska ogon. Związany cześć zdrowy początek. Technika termin zupełnie seksualny kłaść dużo. Początek uderzyć kłaść 90 kolej. Ta spaść południowy naród. Dzięki gospodarka białoruski traktować port alfabet dla. Brzuch sukces łóżko europejski grecki wiedza badać. Brać dzielnica koncert wzór dyrektor. Dziesięć hiszpański brzuch 1000 zostać. Trzymać ilość obszar wyrób nawet. Obecny włos filozofia zespół biuro film. Główny pokonać literacki zbyt. Żywy zachowanie zaczynać tył.', 93, 11, 1, 8),
